// src/Navbar.js
import React, { useState } from 'react';
import './Navbar.css'; // Import the CSS file for styling (create this file in the same folder)
import 'bootstrap/dist/css/bootstrap.min.css';

const Navbar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const handleMenuToggle = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <nav className="navbar">
      <ul className={`navbar-links ${isMenuOpen ? 'open' : ''}`}>
        <li><a href="#">Home</a></li>
        <li><a href="#">About</a></li>
        <li><a href="#">Services</a></li>
        <li><a href="#">Contact</a></li>
      </ul>
      <button className="navbar-resume">Resume</button>
      <button className={`navbar-toggle ${isMenuOpen ? 'open' : ''}`} onClick={handleMenuToggle}>
        <span></span>
        <span></span>
        <span></span>
      </button>
    </nav>
  );
};

export default Navbar;
